+            public void f() {
+                System.err.println(x);
+            }
+        }
+        return Local.class;
+    }
+
+    public Class<?> localCapturesEnclosing() {
+        class Local {
+            public void f() {
+                System.err.println(InnerClasses.this);
+            }
+        }
+        return Local.class;
+    }
+
+    public Class<?> anonCapturesParameter(final int x) {
+        return new Object() {
+            public void f() {
+                System.err.println(x);
+            }
+        }.getClass();
+    }
+
+    public Class<?> anonCapturesLocal() {
