+    }
+
+    public Class<?> anonCapturesEnclosing() {
+        return new Object() {
+            public void f() {
+                System.err.println(InnerClasses.this);
+            }
+        }.getClass();
+    }
+
+    public static class StaticMemberClass {}
+
+    public class NonStaticMemberClass {}
+
+    public class NonStaticMemberClassCapturesEnclosing {
